import React from 'react';
import Link from 'next/link'

import {Section} from './styles'

const BtnLaunches = () => {
  return (
    <Section>
      <Link href='/launches/prev'>
        <a>past launches</a>
      </Link>
      <Link href='/launches/next'>
        <a>next launches</a>
      </Link>
    </Section>
  );
};

export default BtnLaunches;
